import { Link } from "react-router-dom";
import styled from "styled-components";

const TagsList = ({ items, onItemSelect }) => {
  return (
    <TagSideBar>
      <p>Popular Tags</p>
      <div className="tag-list">
        {items.map((item) => (
          <TagLink to="#">{item}</TagLink>
        ))}
      </div>
    </TagSideBar>
  );
};

export default TagsList;

const TagSideBar = styled.div`
  padding: 5px 10px 10px;
  background-color: #f3f3f3;
  border-radius: 4px;
  text-align: left;
  display: flex;
  flex-flow: column;
`;

const TagLink = styled(Link)`
  background-color: #818a91;
  color: #fff;
  text-decoration: none;
  font-size: 0.8rem;
  padding-top: 0.1rem;
  padding-bottom: 0.1rem;
  padding-right: 0.6em;
  padding-left: 0.6em;
  border-radius: 10rem;
  margin-right: 3px;
  margin-bottom: 3.2px;
  margin-left: 0px;
  :hover {
    background-color: #687075;
  }
  display: block;
`;
